import classes from './Categories.module.css';
import { useState } from 'react';
import Showdropdownlist from './Showdropdownlist';

const Categories = () => {
    const [isHovered, setisHovered] = useState(false);
    return (
            <span className='total' 
            onMouseC={() => setisHovered(true)}
            onMouseLeave={() => setisHovered(false)}>
                <span>
                    All Categories
                </span>
                <svg width="24px" height="24px" viewBox="0 0 1024 1024" data-aut-id="icon" class={classes.svgicon} fill-rule="evenodd"><path class="rui-4K4Y7" d="M85.392 277.333h60.331l366.336 366.336 366.336-366.336h60.331v60.331l-408.981 409.003h-35.307l-409.045-409.003z"></path></svg>
                {isHovered ? <Showdropdownlist /> : null}
            </span>
    );
}
 
export default Categories;
